    <div className="">
      <div className="">
        <p>Copyright &copy; Questpaper 2021</p>
      </div>
      <FaLinkedin />
      <div>
        <FaInstagram />
      </div>

      <div>
        <FaFacebook />
      </div>
    </div>
  );
};

export default Footer;
